#scroll-top{
  position: fixed;
  top: -120%;
  right: 2rem;
  padding: .5rem 1rem;
  font-size: 4rem;
  background: var(--red);
  color: #fff;
  border-radius: .5rem;
  -webkit-border-radius: .5rem;
  -moz-border-radius: .5rem;
  -ms-border-radius: .5rem;
  -o-border-radius: .5rem;
  transition: .5s linear;
  -webkit-transition: .5s linear;
  -moz-transition: .5s linear;
  -ms-transition: .5s linear;
  -o-transition: .5s linear;
  z-index: 1000;
}

#scroll-top.active{
  top:calc(100% - 12rem);
}


.loader-container{
  position: fixed;
  top: 0;left: 0;
  z-index: 10000;
  background: #fff;
  display: flex;
  align-items: center;
  justify-content: center;
  width: 100%;
  height: 100%;
}
.loader-container.fade-out{
  top: -120%;
}











